function setNotification(obj, city, rgb) {
  for (var prop in obj) {
    if (obj[prop].indexOf(city) >= 0) {
      levelMark(prop, rgb);
      return
    };
  };
}

function defineLevel(e, params) {
  $('.level_notation').remove();
  var city = params.city;

  if(!document.getElementById('category')){
      setNotification({ ...light, ...cities }, city, 'rgb(154 179 18)')
      return
  }

  const tree = document.getElementById('category').selectedOptions[0].value
    if (url.includes('dkk/priority')) {
      tree === 'DkkTariffsBlock' || tree === 'DkkCommonBlock'
    ? setNotification({...kz, ...cities}, city, 'rgb(0, 0, 0)')
    : setNotification({ ...kz, ...light, ...cities }, city, 'rgb(0, 0, 0)')
  } else {
    tree === 'DkkTariffsBlock' || tree === 'DkkTariffsCommon'
    ? setNotification(cities, city, 'rgb(0, 0, 0)')
    : setNotification({ ...light, ...podsvetka, ...cities }, city, 'rgb(0, 0, 0)')
  }
};

function levelMark(a, rgb) {
  let opc
  if (rgb) {
      if (a.includes('ГРЯЗЬ') || a.includes('703') || a.includes('ШЫМКЕНТ')){
          rgb = 'rgb(154 179 18)'
      }
      opc = '1'
  } else {
      opc = '0.6'
  }
  $('<span/>', {
    class: 'level_notation',
    style: `display: block; opacity: ${opc}; width: fit-content; width: -moz-fit-content; padding: 2px 4px; margin-left: -4px; background: ${rgb}; border: 1px solid rgb(128,128,128); cursor: pointer`,
    text: a,
    click: function () {
      $(this).toggleClass('hide')
    },
  }).prependTo('.check-thumb-number')
};

$(document).bind('item_info', defineLevel);

